public class InnerEndpointConfigClarifyShapConfigFactory(Action<Humidifier.SageMaker.EndpointConfigTypes.ClarifyShapConfig> factoryAction = null) : SubResourceFactory<Humidifier.SageMaker.EndpointConfigTypes.ClarifyShapConfig>
{

    internal InnerEndpointConfigClarifyTextConfigFactory TextConfigFactory { get; set; }

    internal InnerEndpointConfigClarifyShapBaselineConfigFactory ShapBaselineConfigFactory { get; set; }

    protected override Humidifier.SageMaker.EndpointConfigTypes.ClarifyShapConfig Create()
    {
        var clarifyShapConfigResult = CreateClarifyShapConfig();
        factoryAction?.Invoke(clarifyShapConfigResult);

        return clarifyShapConfigResult;
    }

    private Humidifier.SageMaker.EndpointConfigTypes.ClarifyShapConfig CreateClarifyShapConfig()
    {
        var clarifyShapConfigResult = new Humidifier.SageMaker.EndpointConfigTypes.ClarifyShapConfig();

        return clarifyShapConfigResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.EndpointConfigTypes.ClarifyShapConfig result)
    {
        base.CreateChildren(result);

        result.TextConfig ??= TextConfigFactory?.Build();
        result.ShapBaselineConfig ??= ShapBaselineConfigFactory?.Build();
    }

} // End Of Class

